      body: "This is a very minor patch release to update a dependency that's causing
        gomplate to trigger vulnerability scanners for CVE-2022-27664.\r\n\r\nTo the
        best of my understanding gomplate is not vulnerable, as it doesn't expose
        any HTTP servers - this patch release is purely to help vulnerability scans
        pass!\r\n\r\n## What's Changed\r\n* Bump dependencies with unrelated CVEs
        by @hairyhenderson in https://github.com/hairyhenderson/gomplate/pull/1501\r\n\r\n\r\n**Full
        Changelog**: https://github.com/hairyhenderson/gomplate/compare/v3.11.2...v3.11.3"
